  window.applyConfirmablePrevalidado = () => {
    $('.btn-confirmable-prevalidado').unbind( "click" ).on('click', function () {
      $('.errores-publicacion').addClass('hidden');
      var action = $(this).data('action');
      var prevalidacion = $(this).data('prevalidacion');
      var body = $(this).data('body');
      var no = $(this).data('no');
      var si = $(this).data('si');

      $.get(prevalidacion, function(data) {
        if(data.status == true) {
          BootstrapDialog.confirm({
            message: body,
            type: BootstrapDialog.TYPE_WARNING,
            closable: true,
            draggable: true,
            btnCancelLabel: no,
            btnOKLabel: si,
            btnOKClass: 'btn-primary btn-dialog-OK',
            btnCancelClass: 'btn-link btn-dialog-Cancel',
            callback: function(result) {
              // result true si presiono si, false si se cierra el dialog
              if(result) {
                loadingToggle();
                $.get(action, function(resp) {

                  if(resp.refresh != undefined && resp.refresh == true) {
                    location.reload();
                  }
                  loadingToggle();
                  modalCloseToastSuccess(resp.message);
                  if(resp.status == true) {
                    if(resp.action != undefined) {
                      window[resp.action.function](resp.action.params);
                    }
                    if(resp.url != undefined) {
                      window.location.href = resp.url;
                    }

                  } else {
                    if(resp.errores) {
                      if(resp.error_container != undefined) {
                        $(resp.error_container).html('<ul> </ul>');
                        $(resp.error_container).removeClass('hidden');
                        $(resp.error_container).find('ul').append(resp.message);
                      } else {
                        if(resp.message != null) {
                          dataToast = {};
                          dataToast.alert = 'danger';
                          dataToast.icon = 'times';
                          dataToast.msg = resp.message;
                          if(resp.message.length > 0) {
                            modalCloseToastError(dataToast.msg);
                          }
                        }
                      }
                    }
                  }
                })
              }
            }
          });
        } else {
          if(data.error_container != undefined) {
            $(data.error_container).html('<ul> </ul>');
            $(data.error_container).removeClass('hidden');
            $(data.error_container).find('ul').append(data.message);
            offset = $(data.error_container).offset();
            var objDiv = document.getElementById(data.error_container.replace('#', ''));
            if(objDiv != undefined) {
              objDiv.scrollHeight;
              offset.top = offset.top - objDiv.scrollHeight - 5;
            }
            window.scrollTo(offset);
          } else {
            createModalAlert(data.title, data.message);
          }
        }
      });
    });
  }
