  window.modalToast = (json) => {
    var lista_msg = "<ul>";
    $.each(json.msg, function(i,e) {
      lista_msg += `<li>${e}</li>`;
    });
    lista_msg +="</ul>";
    var handleIcon
    if(json.alert == 'danger') {
      handleIcon = 'hide';
    }
    var html = `<div class="modalToast bck-${json.alert} pull-left" id="modalToast">
                  <div class="modalToast-content">
                    <i class="fa fa-${json.icon}-circle fa-2x ${handleIcon}"></i>
                    ${lista_msg}
                  </div>
                </div>`;


    if(json.alert == 'success') {
      $('.modal').find('.modal-footer .col-md-12:first-child').prepend(html);
      setTimeout(() => {
        $('.modal').find('.modalToast').remove();
      }, 5000);
    }
    else if(json.alert == 'danger') {
      var html_content = `<div class="row"><div class="col-md-12 gralErrors">${html}</div></div>`;
      $('.modal').find('.modal-body .modalContentScrollable').prepend(html_content);
      $('.modal').find('.modal-body .modalContentScrollable').animate({scrollTop: 0});
    }
  }
