    window.mostrarErroresEnInput = (errores, as_string) => {
      var show_alert_danger = false;
      if(Object.keys(errores).length > 0 ) {
        $.each(errores, (i, e) => {
          $('#' + i).closest('.form-group').addClass('has-error');
            var html = `<span id="error_${i}" class="help-block">${e}</span>`;
            if($('#' + i).is(':input[type=file]')) {
              $('#' + i).closest('.file-input-new').append(html);
              $('#' + i).closest('.file-input').append(html);
            }
            else {
              $(html).insertAfter('#' + i);
            }
            if($('#' + i).length == 0) {
              if(typeof(e) == "object") {
                $.each(e, (ie, ee) => {
                  var html = `<li>${ee}</li>`;
                  $('.alert-danger ul').append(html);
                  show_alert_danger = true;
                });
              } else {
                if(as_string)
                  var html = `${e}`;
                else
                  var html = `<li>${e}</li>`;
                $('.alert-danger ul').append(html);
                show_alert_danger = true;
              }
            }
        });

        if(show_alert_danger)
          $('.alert-danger').removeClass('hidden');

        $('.modal .form-control').change(function() {
          $(this).closest('.form-group').removeClass('has-error');
          $(this).closest('.form-group').find('.help-block').remove();
          $(this).closest('.form-group').parent().find('.help-outside').remove();
          $('.toggleErrorMark').removeClass('ErrorMarkDanger');
        });
      }
    };
