      // $jsonResponse['span']['id']  array | opcional | se actualiza el valor de ese span
      // return response()->json($jsonResponse);
      window.applyFormAjax = (form_name = '#form-ajax') => {
        $(form_name).off('submit').on('submit', function(e) {
          if($("input[type=submit][clicked=true]").hasClass('borrador'))
            $('#borrador').val(1);
          else
            $('#borrador').val(0);

          $('.help-block').remove();
          $('.form-group').removeClass('has-error');
          $('.alert-danger').addClass('hidden');
          $('.alert-danger').html('<ul> </ul>');

          e.preventDefault();
          if(!$('body').find('.gralState').hasClass('state-loading')) {
            loadingToggle();
          }

          var action = $(form_name).data('action');
          $.ajax({
            url: action,
            type: 'POST',
            dataType: 'json',
            data: new FormData($(form_name)[0]),
            processData: false,
            contentType: false,
            success: function(resp) {
              if(resp.id != undefined)
                $('#id').val(resp.id);

              if(resp.status == true) {
                if(resp.message != undefined)
                  modalCloseToastSuccess(resp.message);
                if(resp.url != undefined) {
		              window.location.href = resp.url;
                }
                if(resp.refresh != undefined && resp.refresh == true) {
                  location.reload();
                }
                if(resp.a_confirmar) {
                  if($('body').find('.gralState').hasClass('state-loading')) {
                    loadingToggle();
                  }

                  $('.content-buttons-bottom-form').toggleClass('hidden');
                  $('#confirmado').val(1)
                  $('.message-confirm').html(resp.conf_message);
                }

                if(resp.close_modal != undefined) {
                  $(resp.close_modal).modal('hide');
                }

                if(resp.agregar_otro != undefined) {
                  if(Object.keys(resp.fields).length > 0) {
                    $.each(resp.fields.inputs, (i, input) => {
                      input = $('#' + input);
                      if(input.hasClass('currency')) {
                        if(input.hasClass('4dec'))
                          input.val('0,0000');
                        else
                          input.val('0,00');
                      } else {
                        input.val('');
                      }
                    });
                  }

                  if(resp.modal != undefined)
                   $(resp.modal).find('.modalContentScrollable').scrollTop(0);
                }

                if(resp.span != undefined) {
                  if(Object.keys(resp.span).length > 0) {
                    $.each(resp.span, (id, val) => {
                      $(id).text(val);
                    });
                  }
                }

                if(resp.container != undefined && resp.html != undefined) {
                  loadingToggleThis(resp.container);
                  $(resp.container).html(resp.html);
                  loadingToggleThis(resp.container);
                  applyAll();
                  if(typeof applyAllContrato != "undefined")
                    applyAllContrato();

                  if(typeof applyModals != "undefined")
                    applyModals();
                }

                if($('body').find('.gralState').hasClass('state-loading')) {
                  loadingToggle();
                }

                if(resp.position != undefined) {
                  window.scrollTo($(resp.position).offset());
                  $(resp.position).find('h4').css('background-color', '#ebf2f9');
                }
              } else {
                if(resp.url != undefined) {
                  window.location.href = resp.url;
                }
                if($('body').find('.gralState').hasClass('state-loading')) {
                  loadingToggle();
                }

                if(Object.keys(resp.errores).length > 0) {
                  var as_string = false;
                  if(resp.errores_as_string != undefined && resp.errores_as_string == true)
                    as_string = true;
                  mostrarErroresEnInput(resp.errores, as_string);
                  window.scrollTo($(form_name).position());
                  $('.modal .modalContentScrollable').scrollTop($(form_name).position());
                }

                if(resp.message.length > 0)
                  modalCloseToastError(resp.message);
              }
            }
          });
        });
      }
